// src/components/Home.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <nav>
        <ul>
          {/* Use Link to navigate to internal routes */}
          <li><Link to="/home">Home</Link></li>
          <li><Link to="/quizzes">Quizzes</Link></li>
          <li><Link to="/admin">Admin Dashboard</Link></li>
          <li><Link to="/logout">Logout</Link></li>
        </ul>
      </nav>

      <div className="container">
        <header>
          <h1>Welcome to the Phishing Simulator & Educator</h1>
          <p>Learn about phishing, test your skills, and protect yourself online.</p>
        </header>

        {/* If you still want anchor links for #education or #gallery on the same page, keep them as <a href="#education"> */}
        {/* Or convert them to <Link to="/education"> if you want them as separate routes */}
      </div>
    </div>
  );
};

export default Home;
